        async           = require('async'),
        ads         = require("./lib/ads.js"),
        Waterfall   = require("./lib/waterfall.js"),
        waterfalls = {};

    waterfalls.banner       = Object.create(Waterfall);
    waterfalls.banner.init([{name:"nativeFormat",prob:1.0},{name:"banner",prob:1.0}]);

    waterfalls.interstitial = Object.create(Waterfall);
    waterfalls.interstitial.init([{name:"nativeFormat",prob:1.0},{name:"video",prob:1.0},{name:"banner",prob:1.0}]);

    var downloadWaterfalls = function(invh){

        var url = "http://sdk.starbolt.io/waterfalls.json", 
            params = {};

        if(invh){
            params.p = invh;
        }

        var req = superagent.get(url).query(params);

        if(typeof(window)==="undefined"){ //server side.
            req = superagent.get(url).query(params).buffer();
        }

        req.end(function(err,res){
            if(err) return;
            var json = res.body.waterfalls;
            waterfalls.banner.types         = json.banner;
            waterfalls.interstitial.types   = json.interstitial;
        });
    };

