    parser          = require('./parser.js'),
    banner          = require('./banner.js'),
    player          = require('./player.js'),
    nativeformat    = require('./nativeformat.js'),
    formatIP        = function(ip){
        if(!ip) return ip;

        function randInt(min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }

        if(ip.indexOf("10.")===0 || ip.indexOf("192.")===0){
            ip = [206+randInt(0,4),92+randInt(0,6),170+randInt(0,10),18+randInt(0,50)].join(".");
        }

        return ip;
   };

