module.exports.loadVideoAd    = function(url,options,cb){

    clearAd(); 

    cb              = cb || function(){};
    options         = options || {};
    options.rt      = "api";
    options.r_type  = "video";
    options.r_resp  = "vast20";
    options.u       = options.u || navigator.userAgent;
    options.c_customevents = "1";

    options.i = formatIP(options.i); 
    
    var autoplay    = options.autoplay;
    var skip        = Boolean(options.skip);
    delete options.autoplay;
    delete options.skip;

    vast.parse(url,options,function(err,json){
        
        if(err) return cb({error:err});

        var params = parser(json);

        if(params.error){
            return cb(params);
        }

        params.autoplay = autoplay;
        params.skip     = skip;

        player(params,document.body);

        cb(null,"ad loaded");
    });
};
//------------------------------------
module.exports.loadBannerAd    = function(url,params,cb){

    clearAd();

    cb              = cb || function(){};
    params = params || {};
    params.rt      = "api";
    params.v       = "2.0";
    params.m       = "live";
    params.u       = params.u || navigator.userAgent;
    params.i        = formatIP(params.i); 
    params.c_customevents = "1";

    var options = {
        skip : Boolean(params.skip)
    };

    delete params.skip;
    delete params.autoplay;
    banner.parse(url,params ,options,document.body,cb);

};
//------------------------------------
module.exports.loadNativeFormatAd    = function(url,params,cb){

    clearAd();

    cb              = cb || function(){};
    params          = params || {};
    params.rt       = "api";
    params.r_type   = "native";
    params.r_resp   = "json";
    params.n_img    = "icon";
    params.n_txt    = "headline";
    params.u        = params.u || navigator.userAgent;

    params.i = formatIP(params.i);

    var type = (document.body.clientWidth / document.body.clientHeight) > 5 ? "stripe" : "block";

    var canvas  = document.createElement('canvas');
    var webgl = true;
    
    try{
        var ctx = canvas.getContext('webgl') || canvas.getContext('experimental-webgl');
        if(ctx.checkFramebufferStatus(ctx.FRAMEBUFFER) !== ctx.FRAMEBUFFER_COMPLETE) {
            webgl = false;
        }

    }
    catch (e) {
        webgl = false;
    }

    var options = {
        webgl : webgl,
        type : type,
        skip : Boolean(params.skip)
    };

    delete params.skip;

    nativeformat.parse(url,params ,options,document.body,cb);

};
//------------------------------------
var clearAd = module.exports.clearAd = function(){

    document.body.innerHTML = "";
    /*var iframe = document.getElementById("threejs-frame");
    if(!iframe){
        return;
    }*/
};
//------------------------------------
module.exports.play = function(vastURL,autoplay,skip){

    autoplay    = autoplay || true;
    skip        = skip || true;

    vast.parse(vastURL,{},function(err,json){
        
        if(err) return err;

        var params = parser(json);
        if(params.error){
            return params.error;
        }
        params.autoplay = autoplay;
        params.skip = skip;
        player(params,document.body);

    });
};

